	// };

	const options = {
		method: 'POST',
		headers: {
			'Content-Type': 'application/json',
		},
		// body: JSON.stringify(update),
		body: JSON.stringify(
			{
				username: "fab",
				email: "fabio@gmail.com",
				password: "123"
			}
		),
	};
	console.log(options)
	let response = await fetch(urlServer, options)
	console.log(response)
	return(response)
}
